import React from 'react';
import './Header.css'

function Header(props) {
    return (
        <nav className="navbar navbar-expand-lg navbar-light bg-white fix_header">
            <a className="navbar-brand" href="#">TIENKIM STUDY</a>
            <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
            </button>

            <div className="collapse navbar-collapse" id="navbarSupportedContent">
                <ul className="navbar-nav mr-auto">
                    <li className="nav-item active">
                        <a className="nav-link" href="#">Docs <span className="sr-only">(current)</span></a>
                    </li>
                </ul>
            </div>

            <div className="mr-sm-2 d-flex">
                
                <input type="checkbox" name="checkbox" className="switch" />
            </div>
        </nav>
    );
}

export default Header;
